import { React } from "react";
import { useUser } from "../components/auth/useUser.js";

async function Dashboard() {
	const user = useUser();
	console.log(user);
	const { username, email, admin } = user;

	return (
		<div>
			<h1>{username}</h1>
			<h2>{email}</h2>
			<h3>{admin}</h3>
		</div>
	);
}

export default Dashboard;
